// EventRegister.js
import React, { useState } from "react";

export function EventRegister() {
  // State variables for the form
  const [name, setName] = useState("");
  const [phone, setPhone] = useState("");
  const [eventId, setEventId] = useState("");

  // Handle form submission
  const handleRegisterEvent = async (e) => {
    e.preventDefault();

    // Frontend validation
    if (!name || !phone || !eventId) {
      alert("Please fill all fields");
      return;
    }

    try {
      // Log what is being sent to server
      console.log("SENDING EVENT:", { name, phone, eventId });

      const response = await fetch("http://localhost:3001/registerEvent", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          name: name.trim(),
          phone: phone.trim(),
          eventId: eventId.trim(),
        }),
      });

      const data = await response.json();

      if (!response.ok) {
        console.error("SERVER ERROR:", data);
        alert(data.error || "Failed to register event");
        return;
      }

      alert("Event registered successfully!");
      // Clear form
      setName("");
      setPhone("");
      setEventId("");
    } catch (error) {
      console.error("NETWORK ERROR:", error);
      alert("Server error. Please try again.");
    }
  };

  return (
    <div style={{ maxWidth: "500px", margin: "20px auto", padding: "10px" }}>
      <h2>Register for an Event</h2>
      <form onSubmit={handleRegisterEvent}>
        <div style={{ marginBottom: "10px" }}>
          <label>Name:</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Your Name"
            required
            style={{ width: "100%", padding: "8px" }}
          />
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label>Phone:</label>
          <input
            type="text"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            placeholder="Your Phone"
            required
            style={{ width: "100%", padding: "8px" }}
          />
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label>Select Event:</label>
          <select
            value={eventId}
            onChange={(e) => setEventId(e.target.value)}
            required
            style={{ width: "100%", padding: "8px" }}
          >
            <option value="">-- Select an Event --</option>
            <option value="EVT-1">Event 1</option>
            <option value="EVT-2">Event 2</option>
            <option value="EVT-3">Event 3</option>
          </select>
        </div>

        <button
          type="submit"
          style={{
            padding: "10px 20px",
            backgroundColor: "#4caf50",
            color: "white",
            border: "none",
            cursor: "pointer",
          }}
        >
          Register
        </button>
      </form>
    </div>
  );
}

export default EventRegister;
